export interface Tokens {
    access_token: string;
}

export type TokenResponse = {
    referenceId: string;
    tokens: Tokens;
    lastUpdated: number;
    resource: string;
}

export type TokenApiResponse = {
    message: string;
    error: boolean;
    status: number;
    results: TokenResponse;
}

export type TokenLockResponse = {
    tokenData: TokenResponse;
    lockId: string;
}

export type TokenLockApiResponse = {
    message: string;
    error: boolean;
    status: number;
    results: TokenLockResponse;
}

